import React from 'react';
import './App.css';
import SearchMovie from './searchMovies.js'

function App() {
  return (
    <div className="container">
      <table className="titleBar">
        <tbody>
          <tr>
            <td>
              <img alt="app icon" width="50" src=""/>
            </td>
            <td width="8"/>
            <td>
              <h1>Movies Search</h1>
            </td>
          </tr>
        </tbody>
      </table>
      <SearchMovie />
    </div>
  );
}

export default App;
